class HealthLink extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        const link = this.props.step.metadata.link || '';
        const label = this.props.step.metadata.label || '';
        return (
            <a href={link} target="_blank">
                {label}
            </a>
        );
    }
}

export default HealthLink;
